import React, { Component } from 'react'
import axios from 'axios'

import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';



export default class Weather extends Component {

    //Define state default values

    constructor() {
        super();
        this.state = {
            forecast: [],
            coord: {},
            weather: [],
        };
    }

     //Component Lifecycle Callback
    componentDidMount() {
        axios.get(`https:api.openweathermap.org/data/2.5/weather?q=Toronto&appid=0075d6a7c0a4afa060d8299f822f958f`)
        .then(res => {
            console.log(res.data);
            const forecast = res.data;
            const coord = forecast.coord;
            const weather = forecast.weather[0];
            const main = forecast.main;

            console.log(weather)
            this.setState({ forecast, coord, weather, main });
            //this.setState({ coord });
        })
            .catch(err => {
                console.error("Error : ", err)
        })
    }


    render() {
    //const weathermap = this.state.data.wind;

        //const { data = [] } = this.state;
        return (
            <Container className="container-fluid">
                <h1 className="text-center">User List</h1>
                <h1></h1>
                {this.state.weather.id}
                {this.state.coord.lat}


            </Container>
        )
    }

}
